import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App(props) {

  const [count, setCount] = useState(0);
  const [show, setShow] = useState(false);

  function Escondidinho(){
    return (
      <h1> Apareci </h1>
    )
  }

  return (
    <div className="App">
      <h1>
        Count = {count}
      </h1>
      <button onClick = {() => setCount(count + 1)}>
        +
      </button>      
      <button onClick = {() => setCount(count - 1)}>
        -
      </button>
      <br/>
      <button className="flip" onClick = {() => setShow(!show)}>
        Escondidinho
      </button>
      {show && <Escondidinho />}          
    </div>
  );

}



export default App;
